def get_stats(three_d_matrix):
    stats = {}
    for matrix in three_d_matrix:
        for row in matrix:
            for ele in row:
                if ele is not None:
                    if ele in stats:
                        stats[ele]['count'] += 1
                        stats[ele]['total'] += ele
                    else:
                        stats[ele] = {'count': 1, 'total': ele}
    for key in stats.keys():
        stats[key]['avg'] = stats[key]['total'] * stats[key]['count']
    return stats

